import logo from "../../images/logo.svg"
export default function Header({ menu }) {
    return (
        <header className="header">
            <img
                className="header__logo"
                src={logo}
                alt="Логотип Место"
            />
            <div className="menu">
              { menu.map((text, link) => {
                <div className="menu__item"></div>
              }) }
            </div>
        </header>
    )
}
